import './App.css';
import { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import {
  Container,
  Paper,
  Card,
  TextField,
  Button,
  CardContent,
  Stack,
  FormControl,
  FormControlLabel,
  Checkbox,
} from "@mui/material";
import { DatePicker } from "@mui/x-date-pickers/DatePicker";
import { LocalizationProvider } from '@mui/x-date-pickers';
import { AdapterDayjs } from '@mui/x-date-pickers/AdapterDayjs'
//import dayjs from 'dayjs'

const dayjs = require('dayjs')

export default function CreateProgram(){
  const navigate = useNavigate();

  return (
    <>
      <Container fixed maxWidth="sm">
            <Card>
              <CardContent>
                <h1>Create A Program</h1>

                <form>
                  <Stack>
                  <FormControl>
                      <TextField
                        id="outlined-basic"
                        label="Program Name"
                        variant="outlined"
                      />
                    </FormControl>
                    <LocalizationProvider adapter={AdapterDayjs}>
                      <DatePicker defaultValue={dayjs('2024-04-17')} />
                    </LocalizationProvider>
                    <Button sx={{ mt: 1 }} variant="contained" type="submit" onClick={() => navigate("/Home")}>Create</Button>
                    <Button sx={{ mt: 1 }} variant="outlined" type="submit" onClick={() => navigate("/Home")}>Cancel</Button>
                  </Stack>
                </form>
              </CardContent>
            </Card>
          </Container>
    </>
  )
}
